import React, { Component } from 'react';

export default class SpellCard extends Component{
    render() {
        // console.log(this.props.spell)
        return (
            <div>
            <table class="ui selectable inverted table">
  <thead>
    <tr>
      <th>Name</th>
      <th>Status</th>
      <th class="right aligned">Notes</th>
    </tr>
  </thead>
  <tbody>
    <tr>
      <td>John</td>
      <td>Approved</td>
      <td class="right aligned">None</td>
    </tr>
  </tbody>
</table>
            </div>
        );
    }
}
